  is metadata documentation for the Region 7 Air Compliance Complaint Database (ACCD)
  which logs all air pollution complaints received by Region 7. It contains information
  about the complaint along with how the complaint was addressed. The Air and Waste
  Management Division is the primary managing entity for this database.  This work
  falls under objectives for EPA's 2003-2008 Strategic Plan (Goal 1) for Clean Air
  & Global Climate Change, which are to achieve healthier outdoor air.\",\n\t\"license_title\":
